using EntityFrameworkVerificationApp.Data;
using Microsoft.AspNetCore.Mvc;
using Microsoft.AspNetCore.Mvc.RazorPages;
using Microsoft.EntityFrameworkCore;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace EntityFrameworkVerificationApp.Pages.Artists.Profile
{
    public class IndexModel : PageModel
    {
        private static readonly byte[] ArtistImage = Convert.FromBase64String("");

        public IndexModel(CatalogContext catalog)
        {
            Catalog = catalog;
        }

        [FromRoute]
        public int Id { get; set; }
        public CatalogContext Catalog { get; }

        public Artist Artist { get; set; }

        public async Task<IActionResult> OnGetAsync()
        {
            Artist = await Catalog.Artists
                .Include(a => a.Movies)
                .ThenInclude(ma => ma.Movie)
                .ThenInclude(m => m.Details)
                .SingleOrDefaultAsync(a => a.Id == Id);

            return Page();
        }

        [NonHandler]
        public IEnumerable<Movie> GetFilmography() =>
            Artist.Movies.Select(m => m.Movie).OrderBy(m => m.Details.ReleaseDate);

        [NonHandler]
        public int GetAge() =>
            DateTimeOffset.UtcNow.Year - Artist.PersonalInformation.BirthDate.Year;

        [NonHandler]
        public string GetBirthDate() =>
            Artist.PersonalInformation.BirthDate.ToString("MM/dd/yyy");

        public IActionResult OnGetImage() => File(ArtistImage, "img/png");
    }
}